import React, {useState} from 'react'

function Add(){
    const [image, setImage] = useState(null);

    const handleChange = (event) => {
        console.log(event.target.value);
    }

    return(
        <div>
            <h1>Add</h1>
            <form>
                <input type="file" onChange={(e) => handleChange(e)}/>
            </form>
        </div>
    );
}

export default Add;
